import React from 'react';
import hc from './Header.module.css'
import {NavLink} from "react-router-dom";
import {LogOutThunk} from "../../data/AuthReducer";


const Header = (props) => {
    return <header className={hc.header}>
        <div className={`${hc.item} ${hc.active}`}>
            {props.IsLogined
                ? <div>{props.login}<div>
                    <button onClick={props.LogOutThunk}>
                        Logout
                    </button>
                </div>
            </div>
                :
            <NavLink to={'/login'} activeClassName={hc.activeLink}> Login </NavLink>}
        </div>
    </header>

}
export default Header;
